import { useEffect, useState } from "react";
import Navbarcomponent from "../navbar";
import axios from "axios";
import { Card, Row } from "react-bootstrap";
import { useParams } from "react-router";

function BookingComponent() {
  const [customerBook, setCustomerBook] = useState([]);
  const { id } = useParams();

  useEffect(() => {
    axios.get(`http://localhost:8182/customerBook/customerid/${id}`).then((response) => setCustomerBook(response.data));
  }, [id]);

  return (
    <div>
      <div>
        <Navbarcomponent />
      </div>
      <Row className="col-md-3 mb-3">
  {customerBook.map((cb, index) => (
    <div key={index} className="col-md-4 mb-4">
      <div style={{ width: "400px", border: "1px solid #dee2e6", borderRadius: "0.25rem", padding: "10px" }}>
        <div>
          <div style={{ display: "flex", flexDirection: "column", marginBottom: "10px" }}>
            <div>
              <span style={{ fontWeight: "bold" }}>Customer Name:</span> {cb.customer.name}
            </div>
            <div>
              <span style={{ fontWeight: "bold" }}>Issue Date:</span> {cb.issueDate}
            </div>
          </div>
        </div>
      </div>
    </div>
  ))}
</Row>

    </div>
  );
}

export default BookingComponent;
